<?php header('Content-type: text/xml'); ?>
<?php

// Webservice URL
$urlWS = 'http://domain.com.ec/webservice/postReciver.php';

$imagenPostData = 'data:image/jpeg;base64,';
$cod = '1020145879';
$name = 'Name Second';
$email = 'name@domain.com';
$city = 'Angeles';
$date = '2017-09-22';

//start CURL operation
$ch = curl_init();

//Estableciendo opciones
$options = array(
      CURLOPT_POST => 1,
      CURLOPT_URL => $urlWS,
  		CURLOPT_HEADER => 'Content-type: text/xml',
	  	CURLOPT_RETURNTRANSFER => 1,
		  CURLOPT_POSTFIELDS => http_build_query(array(
			'image' => $imagenPostData,
			'cod' => $cod,
			'name' => $name,
			'email' => $email,
			'city' => $city,
			'date' => $date
			)
		)
    ); 

	
    // Set URL Options for returning array set
    curl_setopt_array($ch, $options);

    // Excecuting and capturing result on $xmlUrl
    if( ! $xmlUrl = curl_exec($ch))
    {
        trigger_error(curl_error($ch));
    } 

    // Closing CURL Operation
    curl_close($ch);

    // Printing XML Format
    echo $xmlUrl;

